import axios from 'axios';

const userRegion = localStorage.getItem('userRegion');
userRegion.userRegion.replace()
const searchPlayer = (username) => {
    const url = 'http://localhost:8080/api/v1/players/search?username='+username+'&region='+userRegion;
    return axios.get(url).then(
        (response) => { 
            return response.data.nickname;
        })
        .catch(error => {
        });
};

const fetchTopPlayer = () => {
    const url = "http://localhost:8080/api/v1/players/top?region="+userRegion;
    return axios.get(url).then(
        (response) => {
            return response.data;
        })
        .catch(error => {
            console.log(error)
        });
};

const fetchLatestPlayers = () => {
    const url = "http://localhost:8080/api/v1/players/latest?region="+userRegion;
    return axios.get(url).then(
        (response) => {
            return response.data
        })
        .catch(error=>{
            console.log(error)
        });
}

export default {
    searchPlayer,
    fetchTopPlayer,
    fetchLatestPlayers,
};
